import CreateSubjectForm from "../../components/form/CreateSubjectForm";

function CreateSubject() {
    return (
        <div id="container">
            <div id="content">
                <div id="title">
                    <h1>Maak een Stemming!</h1>
                </div>
            <CreateSubjectForm />
            </div>
        </div>
    );

};

export default CreateSubject;
